import React from 'react';
import './css/style.css';


function App() {
  return (
    <div className="App">
        <nav>
              <h2>Oscars 2019</h2>
              <ul>
                  <li>Home</li>
                  <li>Best Actors</li>
                  <li>Best Actress</li>
                  <li>Best Films</li>
              </ul>
        </nav>

    </div>
  );
}

export default App;
